// App.js
import React from "react";
import "../src/App.css";
import Form from "../components/Form";
import List from "../components/List";

const App = () => {
  return (
    <div className="App">
      <h1>User Registration Form</h1>
      <Form />

      <h2>User List</h2>
      <List />
    </div>
  );
};

export default App;
